import { REGISTER_USER, REGISTER_USER_SUCCESS, LOGIN_USER } from './action';

const initialState = {
  data: [],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case REGISTER_USER:
      return { ...state };
    case REGISTER_USER_SUCCESS:
      console.log(`REDUCER`, action.payload);
      return {
        ...state,
        data: action.payload,
      };
    default:
      return state;
  }
};

export default reducer;
